<body>
    <h2>Подбор дисков</h2>
    <label for="brand">Марка:</label>
    <select id="brand"><option value="">Выберите марку</option></select>
    
    <label for="model">Модель:</label>
    <select id="model"><option value="">Выберите модель</option></select>
    
    <label for="year">Год:</label>
    <select id="year"><option value="">Выберите год</option></select>
    
    <label for="radius">Радиус:</label>
    <select id="radius"><option value="">Выберите радиус</option></select>
    
    <h3>Результаты:</h3>
    <div id="results"></div>
</body>
